import styled from 'styled-components';

export const OuterContainer = styled.div`
  margin: 0;
  padding: 0;
`

export const BlogHeader = styled.div`
  margin-top: 10;
`

export const HeaderTitles = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  color: #444;
`
export const BlogSmallTitle = styled.span`
  position: absolute;
  top: 12%;
  font-size: 20px;
`

export const BlogBigTitle = styled.span`  
  position: absolute;
  top: 20%;
  font-size: 100px;
`

export const BlogCover = styled.img`
  width: 100%;
  height: 450px;
  margin-top: 80px;
  object-fit: cover;
`

